import Footer from "../Components/Footer";
import "./styles/Home.css";
import "../App.css";

function Home() {
	return (
		<div class="home">
			<Navbar />
			<div class="hero-section">
				<h1>Your Daily Digest, Brewed Just How You Like It</h1>
				<p class="subscribe-text">
					<NavLink to="/sign-up" class="subscribe-button">
						Subscribe
					</NavLink>
				</p>
			</div>
			<Footer />
		</div>
	);
}

export default Home;
